    render() {
        const todoList = this.props.todoList;
        if(todoList!==undefined){
            const x = [...todoList]
            console.log(x)
            console.log('haha' + todoList)
        }

        var count = -1;
        return ( 
            <Card title={this.props.message} extra={<Icon type="plus" />} style={{ margin: '80px 0 0 10%', width: '80%' }}>
            <List
            itemLayout="horizontal"
            dataSource={todoList}
            renderItem={item => (
                <List.Item onClick={this.consoleLogID.bind(this,item)}>
                    <List.Item.Meta
                    // title={todoList.getIn([++count,'briefDescription'])}
                    title={item.toJS()}
                    description={todoList.getIn([count,'duedate'])}
                    />
                </List.Item>
            )}
            />
            </Card>
        )
    }

    consoleLogID(item){
        console.log(JSON.parse(JSON.stringify(item)))
    }
}

const mapStateToProps = (state) => {
